db = LinkedList()


def init(cars):
    cars = sorted(cars, key=lambda car: car.price)
    for car in cars:
        new_car = Node(None, None, cars[db.count])
        if db.head is not None:
            new_car.nextNode = None
            new_car.prevNode = db.end
            db.end.nextNode = new_car
            db.end = new_car
        else:
            db.head = db.end = new_car

        db.count += 1


    pass


def add(car):
    new_car = Node(None, None, car)
    hlavicka = db.head
    if db.head is None and db.end is None:
        db.head = db.end = new_car
        return

    elif car.price < hlavicka.data.price:
        new_car.nextNode = hlavicka
        hlavicka.prevNode = new_car
        hlavicka = new_car
        return

    elif car.price > hlavicka.data.price:
        db.end.nextNode = new_car
        new_car.prevNode = db.end
        db.end = new_car
        return

    elif db.end is True and not None:
        if db.end.data.price > car.price:
            db.end = db.end.prevNode
        else:
            db.end = True
            db.end.nextNode.prevNode = new_car
            new_car.nextNode = db.end.nextNode
            db.end.nextNode = new_car
            new_car.prevNode = db.end
            return
    db.count += 1


    pass


